import logo from '../assets/logo_GPN.png';
import './Header.css'
export default function Header() {
    return (
        <header>
            <img src={logo} alt="GPN" id='logo'/>
            <span> Главная </span>
            <span> Продукция </span>
            <span> Технологии </span>
        </header>
    );
}
